                    <h3>Alamat Pengiriman</h3>
                    <form className="box-shipping">
                        <div className="alamat">
                            <label>Alamat</label>
                            <input
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                label="E-mail"
                                placeholder="E-mail"
                            />
                        </div>
                    </form>
                </div>
            </div>
        </Fragment>
    )
}

export default Shipping
